//SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.7.0;

contract HomeAssistant {
    uint public count = 0; //state variable

    struct EntityState {
        string data;
        string date;
        address payable user;
    }

    mapping(uint => EntityState) public entityState;

    function createHistory(
        string memory _data,
        string memory _date,
        address payable _user
    ) public {
        count++;
        entityState[count] = EntityState(_data, _date, _user);
    }
}
